import React from 'react';

function HomePage() {
    return (
        <div className="container mt-5">
            <h1>Welcome to the Maintenance Request System</h1>
            <p>Use this platform to submit and manage maintenance requests efficiently.</p>
        </div>
    );
}

export default HomePage;
